import React, { Component } from 'react'
import PropTypes from 'prop-types';

function Header(props) {
    const logged_out_nav = (
        <div class="header">
            <a href="index.html" class="logo">Loan Management System</a>
            <div class="header-right">
                <a class="active" href="index.html">Home</a>
                <a class="button" onClick={() => props.display_form('signup')}>Register</a>
                <a class="button" onClick={() => props.display_form('login')}>Login</a>
            </div>
        </div>
    );

    const logged_in_nav = (
        <div class="index.html">
            <a href="#default" class="logo">Loan Management System</a>
            <div class="header-right">
                <a class="button">Register</a>
                <a class="button" href="#about">Logout</a>
            </div>
        </div>
    );
    return <div>{props.logged_in ? logged_in_nav : logged_out_nav}</div>;
}

export default Header;

Header.propTypes = {
    logged_in: PropTypes.bool.isRequired,
    display_form: PropTypes.func.isRequired,
    handle_logout: PropTypes.func.isRequired
};
